import { useNavigate } from 'react-router-dom';
import { authService } from './authService';
import { useEffect } from 'react';

const navigate = useNavigate();

export const useRedirectToSignInPage=()=>{
    useEffect(() => {
        if (authService.isLogged) {
          navigate('/signIn');
        }
      }, []);
}
